import React, { Component } from 'react';
import Head from 'next/head'

import Navbar from '../components/navbar/';
import Content1 from '../components/content1';
import Content2 from '../components/content2';
import Content3 from '../components/content3';
import Content4 from '../components/content4';
import Footer from '../components/footer';

class index extends Component {
    projetos() {
        window.open("https://dribbble.com/arthurbarros4", "_blank");
    }
    curriculo() {

        window.open("https://drive.google.com/open?id=1WnnE4JLl_x1q-Vh99yDqlkCd3UByJP7B", "_blank")
    }
    contato() {
        window.location.href = "#footer";
    }

    whatsapp() {
        window.open("https://api.whatsapp.com/send?phone=5588992272118&text=Ol%C3%A1!%20Tenho%20uma%20ideia.", "_blank")
    }
    facebook() {
        window.open("https://www.facebook.com/ArthurBLSonicEffects", "_blank");
    }
    linkedin() {
        window.open("https://www.linkedin.com/in/arthur-bl-703807170/", "_blank");
    }

    render() {
        return (
            <div>
                <Head>
                    <title>Arthur BL - Desenvolvedor Web</title>
                    <meta property="og:locale" content="pt_BR" />
                    <meta property="og:type" content="article" />
                    <meta property="og:title" content="Arthur BL - Desenvolvedor Web" />
                    <meta property="og:description" content="Olá! Eu trabalho como desenvolvedor web, programador PHP e WordPress, na criação de sites e sistemas web." />
                    <meta property="og:site_name" content="Arthur BL" />
                    <meta property="og:image" content="/Assets/imagem-seo.jpg" />
                </Head>
                <Navbar />
                <Content1 />
                <Content2 />
                <Content3 />
                <Content4 />
                <Footer />
            </div>
        );
    }
}

export default index;
